import React,{Component} from 'react';
import {Link,Route} from 'react-router-dom';
import Natureimage from './components/Natureimage';
import { connect } from "react-redux";

import {getData} from './Containers/Users';
import Friends from './Containers/Friends';

export class App extends Component{
    constructor(props) {
        super(props);
      }
       
      componentDidMount() {
        this.props.getData();
      }
render(){
        return(
         <div className='grid-container'>
                <div >
                   <center><label>Menu</label></center>
                    <ul>
                   <li> <Link to ="/">Userinfo</Link> </li>
                   <li><Link to= "/Friends">Friends</Link></li>
                   <li> <Link to="/nature">Photos</Link> </li>
                   </ul>
                </div>
                <div className='item2'>
                <center><label>Contents</label></center>
               
                     <Route path="/" exact component={getData}/> 
                    {this.props.articles.map(el => (
                 <li >{el.Name},{el.Age}</li>
                ))}
                    <Route path="/Friends"  component={Friends}/>
                    <Route path='/nature' component={Natureimage}/>
                  
                </div>
            </div>
        );
    }
}
function mapStateToProps(state) {
    return {
      articles: state.remoteArticles.slice(0, 1)
    };
  }
  
  export default connect(
    mapStateToProps,
    { getData }
  )(App);
